import React from 'react';
import Icon1 from '../../images/PATHSlogo.png';
import Icon2 from '../../images/PATHSlogo.png';
import Icon3 from '../../images/PATHSlogo.png';
import {
  ServicesContainer,
  ServicesH1,
  ServicesWrapper,
  ServicesCard,
  ServicesIcon,
  ServicesH2,
  ServicesP
} from './ServicesElements';

const Services = () => {
  return (
    <ServicesContainer id='services'>
      <ServicesH1>HOW THE FREIGHT LOGISTICS SYSTEM WORKS</ServicesH1>
      <ServicesWrapper>
        <ServicesCard>
          <ServicesIcon src={Icon1} />
          <ServicesH2>Manufacturer</ServicesH2>
          <ServicesP>
          Every item originates in a factory. Manufacturers make and work with various companies to get products to the consumer.
          </ServicesP>
        </ServicesCard>
        <ServicesCard>
          <ServicesIcon src={Icon2} />
          <ServicesH2>Shipper</ServicesH2>
          <ServicesP>
          Several shippers work with manufacturers to get the product or freight on a truck to be delivered to various parts of the U.S.
          </ServicesP>
        </ServicesCard>
        <ServicesCard>
          <ServicesIcon src={Icon3} />
          <ServicesH2>Broker</ServicesH2>
          <ServicesP>
          Brokers act as middleman in order to get the freight booked with a carrier in order to move the product to its destination.
          </ServicesP>
        </ServicesCard>
      </ServicesWrapper>
    </ServicesContainer>
  );
};

export default Services;
